import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
    Card,
    CardHeader,
    ListGroup,
    ListGroupItem,
    Row,
    Col,
    Form,
    FormGroup,
    FormInput,
    FormSelect,
    FormTextarea,
    DatePicker,
    FormCheckbox,
    Button
} from "shards-react";

const OpenForm = () => {
    <Card>
        <CardHeader>
            <h6></h6>
        </CardHeader>
        <ListGroup></ListGroup>
    </Card>
    return (
        <div>OpenForm</div>
    )
}

export default OpenForm
